import Burger from 'react-css-burger';
import React, { Component } from 'react';

class App extends Component {
  state = {
    active: false,
  };

  render() {
    return (
      <Burger
        onClick={() => this.setState({ active: !this.state.active })}
        active={this.state.active}
        burger="mini"
        color="#dc3ab8c9"
        hoverOpacity={0.8}
        scale={1.2}
      />
    );
  }
}
